import React, { Component } from 'react';
import 'semantic-ui-css/semantic.min.css';
import { Button, Form, Grid, Header, Image, Segment, Dimmer, Loader, Label, Checkbox } from 'semantic-ui-react';
import axios from 'axios';
import validForm from '../../Service/ValidStateForm'
class EnterpriseSignUp extends Component {
    state = {
        form: {
            Name: {
                type: "text",
                icon: "user",
                text: "Name",
                value: "",
                maxLength: 40,
                validition: {
                    required: true,
                    pattern: "^[a-zA-Z ]*$"
                },
                valid: false,
            },
            Email: {
                type: "text",
                icon: "envelope",
                text: "E-mail address",
                value: "",
                maxLength: 50,
                validition: {

                    required: true,
                    pattern: "/^\w+([\.-]?\w+)*@\w+([\.-]?\w+)*(\.\w{2,3})+$/^[0-9]*$"
                },
                valid: false,
            },
            Password: {
                type: "Password",
                icon: "lock",
                text: "Password",
                value: "",
                maxLength: 15,
                validition: {
                    required: true,
                },
                valid: false,
            },
            Phone: {
                type: "text",
                icon: "phone",
                text: "Phone",
                value: "",
                maxLength: 10,
                validition: {
                    required: true,
                    pattern: "^[0-9]*$"
                },
                valid: false,
            },
            Url: {
                type: "text",
                icon: "paper",
                text: "Url",
                value: "",
                maxLength: 100,
                validition: {
                    required: true,
                },
                valid: false,
            },
        },
        trySend: false,
        loading: false,
        errorMessage:"",
    }
    onChangeHendler = (e, id) => {
        const form = { ...this.state.form };
        const inputChanged = { ...form[id] };
        // const value = inputChanged.value;
        // if (!inputChanged.validation["pattern"].test(e.target.value)) {
        //     console.log(inputChanged.value)
        //     e.target.value = inputChanged.value
        // }
        // else
        inputChanged.value = e.target.value;
        console.log(inputChanged)
        form[id] = inputChanged;
        this.setState({ form: form })
    }
    SignUp = () => {
        axios.post(`http://localhost:64430/api/Enterprises`, {
        }).then(x => {
                this.props.history.replace('/enterprises/login');
                console.log(x);
            }
            ).catch(x => {
                document.getElementById("message").innerHTML = x.response.data.Message;
            });
    }
    render() {
        const array = [];
        for (let x in this.state.form) {
            array.push({ id: x, config: this.state.form[x] })
        }
        console.log(array)
        return (<div>
            <Grid textAlign='center' style={{ height: '100vh' }} verticalAlign='middle'>
                <Grid.Column style={{ maxWidth: 450 }}>
                    <Header as='h2' color='teal' textAlign='center'>
                        <Image src='/Images/logo.png' /> Sign-Up to your account
                  </Header>
                    <Form size='large' onSubmit={this.SignUp}>
                        <Segment stacked>
                            {array.map((x, i) => {
                                console.log(x.config)
                                return <Form.Input
                                    key={i} iconPosition="left"
                                    maxLength={x.config.maxLength}
                                    type={x.config.type}
                                    onChange={event => this.onChangeHendler(event, x.id)}
                                    className={this.state.trySend && !this.state.form[x.id].valid ? "error" : x.id}
                                    placeholder={x.config.text + "*"}
                                    icon={x.config.icon}
                                >
                                </Form.Input>
                            })}
                            <div id="message" style={{ color: "red" }}>{this.state.errorMessage}</div>
                            <Checkbox label={<label>I accept the <a href="/agreement" target="_blank">Terms of Service</a></label>} />
                            <Button type="submit" color='teal' fluid size='large'>
                                Sign-Up
                            </Button>
                        </Segment>
                    </Form>
                </Grid.Column>
            </Grid>
            <Dimmer active={this.state.loading} inverted>
                <Loader size='large'>Loading</Loader>
            </Dimmer>
        </div >
        )
    }
}
export default EnterpriseSignUp;
